import React from 'react'
import QuizView from './QuizView'

export default function MyQuizzes() {
    return (
        <div className="my-quizzes">
            <div className="my-quizzes-title">My quizzes</div>
            <section className="cards-list">
                <QuizView />
            </section> 
        </div>
    )
}
